import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

function CreateUser() {
    const [name, setName] = useState("");
    const [lastname, setLastname] = useState("");
    //const [salary, setSalary] = useState("");
    const [cost, setCost] = useState("");
    const [shipment, setShipment] = useState("");
    const [AdressCustomer, setAdressCustomer] = useState("");
    const [message, setMessage] = useState("");
    const [CustomerPhoneNumber, setCustomerPhoneNumber] = useState("");
    const navigate = useNavigate();

    const handleSubmit = async (e) => {
        e.preventDefault();

        // เช็คว่าได้กรอกข้อมูลครบทุกช่องแล้ว
        if (!name || !lastname  || !cost || !shipment || !AdressCustomer || !CustomerPhoneNumber) {
            setMessage("Please fill in all fields.");
            return;
        }

        // ตรวจสอบให้มั่นใจว่า salary และ cost เป็นตัวเลข
        if (isNaN(cost)) {
            setMessage("Salary and cost must be numeric values.");
            return;
        }

        try {
            // ส่งข้อมูลไปที่ API
            await axios.post("http://localhost:5000/create-user", { 
                name, 
                lastname, 
                //salary: parseFloat(salary), // แปลงให้เป็นตัวเลข
                cost: parseFloat(cost), // แปลงให้เป็นตัวเลข
                shipment, 
                AdressCustomer,
                CustomerPhoneNumber 
            });
            navigate('/'); // redirect ไปที่หน้า Home

        } catch (error) {
            setMessage("Error creating user, please try again.");
            console.log(error);

        }
    }

    return (
        <div className="container">
            <h1>Create User</h1>
            {message && <p className="text-danger">{message}</p>}

            <form onSubmit={handleSubmit}>
                <div className="mb-3 w-25">
                    <label className="form-label">Name:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={name}
                        onChange={(e) => setName(e.target.value)}
                        required
                    />
                </div>

                <div className="mb-3 w-25">
                    <label className="form-label">Lastname:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={lastname}
                        onChange={(e) => setLastname(e.target.value)}
                        required
                    />
                </div><div className="w-25 mb-3">
                    <label className="form-label">AdressCustomer:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={AdressCustomer}
                        onChange={(e) => setAdressCustomer(e.target.value)}
                        required
                    />
                </div>

                <div className='w-25 mb-3'>
    <label className='form-label'>CustomerPhoneNumber:</label>
    <input
        type='text'  // เปลี่ยนจาก 'number' เป็น 'text' เพื่อให้สามารถใช้ maxLength ได้
        className='form-control'
        value={CustomerPhoneNumber}
        onChange={(e) => {
            // ตรวจสอบว่าไม่ให้กรอกเกิน 10 หลัก
            if (e.target.value.length <= 10) {
                setCustomerPhoneNumber(e.target.value);
            }
        }}
        maxLength="10"  // ตั้งค่าจำนวนตัวเลขสูงสุดที่สามารถกรอกได้
        required
    />
</div>


                <div className="mb-3 w-25">
                    <label className="form-label">Cost:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={cost}
                        onChange={(e) => setCost(e.target.value)}
                        required
                    />
                </div>

                <div className="w-25 mb-3">
                    <label className="form-label">Shipment:</label>
                    <input
                        type="text"
                        className="form-control"
                        value={shipment}
                        onChange={(e) => setShipment(e.target.value)}
                        required
                    />
                </div>




                <div className="mb-3">
                    <button type="submit" className="btn btn-success">Submit</button>
                </div>
            </form>
        </div>
    );
}

export default CreateUser;
